import React from 'react';
import { Routes, Route, Link, useLocation } from 'react-router-dom';
import Patients from './admin/Patients';
import Medecins from './admin/Medecins';

const AdminDashboard = () => {
  const location = useLocation();

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="lg:ml-64 p-6">
        <Routes>
          <Route path="/" element={
            <div className="p-8 bg-white rounded-xl shadow-sm">
              <h1 className="text-3xl font-bold mb-4">Admin Dashboard</h1>
              <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
                <Link to="/admin/patients" className="p-6 bg-blue-50 border-2 border-dashed border-blue-200 rounded-xl hover:shadow-md">
                  <h3 className="text-xl font-semibold text-blue-800">Patients</h3>
                </Link>
                <Link to="/admin/medecins" className="p-6 bg-green-50 border-2 border-dashed border-green-200 rounded-xl hover:shadow-md">
                  <h3 className="text-xl font-semibold text-green-800">Médecins</h3>
                </Link>
                <div className="p-6 bg-gray-50 border-2 border-dashed border-gray-200 rounded-xl">
                  <h3 className="text-xl font-semibold text-gray-700">Plus...</h3>
                </div>
              </div>
            </div>
          } />
          <Route path="/patients" element={<Patients />} />
          <Route path="/medecins" element={<Medecins />} />
        </Routes>
      </div>
    </div>
  );
};

// ✅ EXPORTS COMPATIBILITÉ
export const AdminLayoutWrapper = ({ children }) => <>{children}</>;
export const DashboardHome = () => (
  <div className="p-8">
    <h1>Admin Home</h1>
  </div>
);

export default AdminDashboard;
